Ik heb begrip voor de vragen en angst van buurtbewoners van een toekomstig asielcentrum. We moeten hen maximaal informeren, tegemoet komen en lokale besturen bijstaan. 

Maar we nemen ook verantwoordelijkheid voor de opvang van vluchtelingen.

@BartSomers in @deafspraaktv https://t.co/UMuCbUii2W

@BartSomers vandaag in @deafspraaktv:  
Veel vrouwen worden geconfronteerd met een ongewenste zwangerschap en abortus. Zij maken een moeilijke en weloverwogen keuze. 

Ik stoor mij dan ook aan weinig respectvolle uitspraken over dit thema, ook van parlementsleden.

"Ik overleg morgen met de burgemeester van Bilzen. Johan Sauwens heeft goed gereageerd, hij verdient onze steun.

Als minister wil ik gemeenten die een asielcentrum hebben ondersteunen, met uitwisseling van best practices om dit beter te laten verlopen."

@BartSomers #terzaketv

